import SideNav, { Toggle, Nav, NavItem, NavIcon, NavText } from '@trendmicro/react-sidenav';
import '@trendmicro/react-sidenav/dist/react-sidenav.css';
import { Link } from "react-router-dom";
import "../Styles/SideNav.css"


const MySideNav = () => {
    return ( 
       <SideNav 
       onSelect={selected=> {
        
       }}
       className='sidenav'
        >
           <SideNav.Toggle />
           <SideNav.Nav defaultSelected="home" style={{fontSize:'30px'}} >
            <NavItem className="nav-item">
                <NavIcon><Link to="/" className='nav-links'><i class="fa-solid fa-house" style={{fontSize:'2em'}}></i></Link></NavIcon>
                <NavText ><Link to="/" className='nav-links' style={{color:'#333'}} >Home</Link></NavText>
            </NavItem>
            <NavItem className="nav-item">
                <NavIcon><Link to="/AllBlogs" className='nav-links'><i class="fa-solid fa-globe" style={{fontSize:'2em'}}></i></Link></NavIcon>
                <NavText><Link to="/AllBlogs" className='nav-links' style={{color:'#333'}}>All-Posts</Link></NavText>
            </NavItem>
            <NavItem className="nav-item" >
                <NavIcon><Link to="/Info" className='nav-links'><i class="fa-solid fa-info" style={{fontSize:'2em'}}></i></Link></NavIcon>
                <NavText><Link to="/Info" className='nav-links' style={{color:'#333'}}>Info</Link> </NavText>
            </NavItem>
            <NavItem className="nav-item">
                <NavIcon><Link to="/Contact" className='nav-links'><i class="fa-solid fa-address-book" style={{fontSize:'2em'}}></i></Link></NavIcon>
                <NavText><Link to="/Contact" className='nav-links' style={{color:'#333'}}>Contact</Link></NavText>
            </NavItem>
           </SideNav.Nav>
        </SideNav>
       )
}
 
export default MySideNav;
